import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <div className='container'>
        <h1>Fruits</h1>
        <h2>Shop</h2>
        <h2>Cart</h2>
      </div>
      <div className='info'>
        <div className='slogan'>Check out this wide assortment of fruits!</div>
        <button className='shopBtn'>SHOP</button>
      </div>
    </div>
  );
}

export default App;
